export default makeStyles(() => ({
    container: {
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        width: "100%",
        // padding: 0
    },
    buttonContainer: {
        width: '100%',
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100%"
    },
}))
